import React, { Component } from 'react';
import { Grid } from '@material-ui/core';
import Axios from "../components/axiosProp";

export default class Propiedad extends Component {
    render() {
        const { match } = this.props
        const { val } = match.params.id

        return (
            <div>
                <h1>val</h1>
                        <Axios value={val} />
            </div>
        )
    }
}
